SELECT N'7' AS [OperatorID], N'IN' AS [strOperator], N'%INLIST%' AS [strLogic] UNION ALL
SELECT N'8' AS [OperatorID], N'BETWEEN' AS [strOperator], N'%strLowValue% AND %strHighValue%' AS [strLogic] UNION ALL
SELECT N'9' AS [OperatorID], N'IS' AS [strOperator], NULL AS [strLogic] UNION ALL
SELECT N'10' AS [OperatorID], N'IS NOT' AS [strOperator], NULL AS [strLogic] UNION ALL
